import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <div classname="app">
        <Routes>
          <Route path="/checkout" />
          <Router path="/login" />
          <Route path="/" />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
